import React from "react";
import { useImageData } from '../ImageProvider';

const Home = () => {
    const { projectData, loading, error } = useImageData();

    if (loading) return <div>Loading...</div>;
    if (error) return <div>{error}</div>;

    const bannerFolder = projectData.find(folder => folder.folder === "banners");
    console.log(bannerFolder.images[1]);

    const pic1 = "https://vkvrestauraties.s3.eu-central-003.backblazeb2.com/DSC00234.webp";
    const pic2 = "https://vkvrestauraties.s3.eu-central-003.backblazeb2.com/DSC00383.webp";
    const pic3 = "https://vkvrestauraties.s3.eu-central-003.backblazeb2.com/DSC00480.webp";
    const pic4 = "https://vkvrestauraties.s3.eu-central-003.backblazeb2.com/DSC00490.jpg";
    const pic5 = "https://vkvrestauraties.s3.eu-central-003.backblazeb2.com/DSC00500.jpg";
    const pic6 = "https://vkvrestauraties.s3.eu-central-003.backblazeb2.com/DSC00510.jpg";
    const pic7 = "https://vkvrestauraties.s3.eu-central-003.backblazeb2.com/DSC00600.jpg";

    return (
        <div className="w-full h-full">
            <img src={pic2} alt="pic1" className="w-full h-full object-cover"/>
        </div>
    );
}

export default Home;
